function etape1_appuie_A () {
    if (curseur.overlapsWith(PC)) {
        music.playTone(494, music.beat(BeatFraction.Sixteenth))
        game.splash("Non c'est pas", "cura!")
    }
    if (curseur.overlapsWith(Fusion)) {
        music.playTone(494, music.beat(BeatFraction.Sixteenth))
        music.playMelody("C C5 F F C5 C5 D D ", 600)
        game.splash("Tu connais", "Fusion 360 ?")
        music.playMelody("C C5 C5 E E C5 C5 C5 ", 600)
        game.splash("C'est super", "pour faire des objets")
        music.playMelody("C C C C C C C C ", 600)
        game.splash("et les imprimer", "en 3D")
        music.playMelody("C C5 - - C C C C ", 600)
        game.splash("mais là c'est déjà fait", "va sur Cura!")
    }
    if (curseur.overlapsWith(CURA)) {
        music.playTone(988, music.beat(BeatFraction.Sixteenth))
        music.playMelody("C5 C5 - G C5 - G B ", 300)
        CURA.destroy()
        Fusion.destroy()
        PC.destroy()
        curseur.destroy()
        Etape2()
        etape_actuel = 2
        game.splash("Tu sais comment utiliser", "Cura ?")
        game.splash("Si tu es perdu, n'hésite ", "pas à demander")
        game.splash("Appuie sur une partie", "et je t'explique!")
        game.splash("Sinon ouvre le fichier STL", "J'ai envie d'imprimer moi!")
    }
}
